import os

from nwnsdk import NwnClient, PostgresConfig, RabbitmqConfig, WorkFlowType
from dotenv import load_dotenv

load_dotenv()

input_esdl = ""

postgres_config = PostgresConfig(
    host=os.environ.get("POSTGRES_HOST", "localhost"),
    port=os.environ.get("POSTGRES_PORT", "5432"),
    database_name=os.environ["POSTGRES_DATABASE_NAME"],
    user_name=os.environ["POSTGRES_ROOT_USER"],
    password=os.environ["POSTGRES_ROOT_PASSWORD"],
)
rabbitmq_config = RabbitmqConfig(
    host=os.environ["RABBITMQ_HOST"],
    port=int(os.environ["RABBITMQ_PORT"]),
    exchange_name=os.environ["RABBITMQ_EXCHANGE"],
    user_name=os.environ["RABBITMQ_ROOT_USER"],
    password=os.environ["RABBITMQ_ROOT_PASSWORD"],
    hipe_compile=os.environ.get("RABBITMQ_HIPE_COMPILE", "1"),
)

nwn_client = NwnClient(postgres_config=postgres_config, rabbitmq_config=rabbitmq_config)

nwn_client.start_work_flow(
    work_flow_type=WorkFlowType.GROWTH_OPTIMIZER, job_name="job1234", esdl_str=input_esdl, user_name="fleursl"
)
